    data: |
      SELECT * FROM tab1 (FORMAT parquet) AS cor0 WHERE + col1 + - - col0 NOT IN ( + col0, - 74 / + col1 ) AND NOT ( col2 ) IS NULL;
  - name: tab1

outputs:
  - name: q10290.out
    data: |
      51	14	96
      85	5	59
      91	47	68
